import React from "react";

import "./collection-item.styles.scss";

const CollectionItem = ({ name, price, id, imageUrl }) => {
  return (
    <div className="collection-item">
      <div
        className="image"
        style={{
          backgroundImage: `url(${imageUrl})`,
        }}
      ></div>
    </div>
  );
};

export default CollectionItem;
